import React from 'react'


const Pagination=({totalResults})=>{
	let pageNumber=[];
	 
	console.log(totalResults)
	let numerodepaginas= totalResults/15;
	console.log(numerodepaginas)
	let tests= Math.ceil(totalResults /15)
	console.log(tests)
	for(let i=1; i<= tests; i++) {
		pageNumber.push(i);
	}
	console.log(pageNumber)
	return(
		<nav>
			<ul className='pagination'>
				<p>pagination</p>

			</ul>
		</nav>
		)
}


export default Pagination;
